    private static String[]       DTG_THREAD_POOL    = { "threadPoolForWriteCache",
        "threadPoolForDbFix", "threadPoolForStation", "threadPoolForYuweiCacheMerge",
        "threadPoolForMergePrice", "threadPoolForRefreshPrice", "threadPoolRedisCache",
        "threadPoolForFetchResult", "httpTrainMessageProducer", "stationDbConsumer",
        "stationPairDbConsumer", "freeIpQueryDataThreadPool", "freeIpThreadPool",
        "freeIpSearchThreadPool", "freeIpPageThreadPool", "freeIpCheckThreadPool",
        "threadPoolForRefreshPriceNew", "threadPoolForMergePriceNew", "threadPoolForMQ",
        "threadPoolForStationMerge", "httpExecutor", "jobExecutor",
        "dtcJobExecutor", "cacheDataExecutor", "queryDataExecutor", "grabDataExecutor" };

    public static ThreadPoolTaskExecutor getThreadPoolExecutor(ThreadPoolTaskExecutor temp) {

    try {

        if (temp.getActiveCount() < temp.getCorePoolSize()
            && temp.getThreadPoolExecutor().getQueue().size() == 0) {
            return temp;
        }
        for (int i = 0; i < DTG_THREAD_POOL.length; i++) {
            ThreadPoolTaskExecutor executor = SpringContext.getBean(StringUtils.trim(Constant.DTG_THREAD_POOL[i]), ThreadPoolTaskExecutor.class);
            if (executor != null
                && executor.getThreadPoolExecutor().getQueue().size() == 0
                && executor.getActiveCount() < (executor.getCorePoolSize() - executor
                    .getCorePoolSize() / 3)) {
                return executor;
            }
        }
    } catch (Exception e) {
    }
    return temp;
}
